const isEmptyObject = obj => {
	for (let prop in obj) {
		if (obj.hasOwnProperty(prop)) {
			return false;
		}
	}
	return JSON.stringify(obj) === JSON.stringify({});
};
export const helper = {
	isEmptyObject
};
